INSERT INTO `news` (`id`, `title`, `thumbnail`, `shortdescription`, `content`, `categoryid`, `createddate`, `modifieddate`, `createdby`, `modifiedby`) VALUES
('tb01', 'CHUYẾN \"XE VỀ NHÀ\" 2025 TÀI TRỢ BỞI KMS TECHNOLOGY', , 'CHUYẾN \"XE VỀ NHÀ\" 2025 TÀI TRỢ BỞI KMS TECHNOLOGY', 'Không khí Tết đang dần len lỏi trên khắp phố phường, cùng niềm háo hức của người người nhà nhà về quê sum vầy sau một năm vất vả bộn bề nơi Thành phố. Tuy vậy, vẫn còn những em sinh viên khó khăn khát khao được cầm trên tay một tấm vé về nhà. Việc xoay xở, vật lộn với chi phí học tập và sinh hoạt đã là một nỗi lo lắng quá lớn cho các em, khiến việc trở về quê là điều vượt ngoài mơ ước. Tết ở gần nhưng lại rất xa.\n\nThấu hiểu những trăn trở này, KMS Technology hân hạnh mang những chuyến \"Xe Về Nhà\" đến các bạn sinh viên IT có hoàn cảnh khó khăn mùa thứ 6 liên tiếp.\n\nThông tin chi tiết chương trình:\n\n💙 Tài trợ 100% tiền vé xe, tàu khứ hồi.\n\n💙 Đối tượng: Sinh viên khối ngành CNTT đang theo học tại TP. HCM và Đà Nẵng có hoàn cảnh khó khăn\n\n👉 Hồ sơ đăng ký bao gồm đầy đủ các giấy tờ sau:\n\n> Minh chứng hoàn cảnh khó khăn (giấy chứng nhận hộ nghèo/cận nghèo, xác nhận của địa phương)\n\n> Bảng điểm học kỳ gần nhất\n\n> Thư trình bày nguyện vọng\n\n> Minh chứng vé xe/tàu đã mua (nếu có)\n\n👉 Nộp đơn tại: https://forms.gle/a3r5oAYcpst1TcLv5 \n\n👉 Thời gian chương trình:\n\n> 16/12/2024- 25/12/2024: Mở đơn nhận hồ sơ\n\n> 26/12/2024 - 05/01/2024: Xét duyệt\n\n> 07/01/2025: Thông báo kết quả\n\n👉Thông tin liên lạc:\n\n> Email: KMS-Gives-VN@kms-technology.com', 'thongbao', '2024-12-17 14:17:06', '2024-12-17 19:08:26', 'admin', 'admin');
INSERT INTO `news` (`id`, `title`, `thumbnail`, `shortdescription`, `content`, `categoryid`, `createddate`, `modifieddate`, `createdby`, `modifiedby`) VALUES
('tb02', 'Đề cử vòng 2 sinh viên nhận học bổng Tập đoàn Thép JFE Nhật Bản', , 'Đề cử vòng 2 sinh viên nhận học bổng Tập đoàn Thép JFE Nhật Bản', '➡Các bạn sinh viên có tên theo danh sách nộp thông tin về Khoa CNTT theo địa chỉ: cntt@dut.udn.vn (cc email: ltmhanh@dut.udn.vn). Hạn cuối ngày 15/12/2024', 'thongbao', '2024-12-17 14:17:06', NULL, 'admin', NULL);
INSERT INTO `news` (`id`, `title`, `thumbnail`, `shortdescription`, `content`, `categoryid`, `createddate`, `modifieddate`, `createdby`, `modifiedby`) VALUES
('tb03', '[LGEDV DN] Cuộc thi Dream Code 2024', , '[LGEDV DN] Cuộc thi Dream Code 2024', '1. Tên chương trình: Cuộc thi LG Dream Code 2024\n\n2. Đối tượng tham gia: Sinh viên các trường đại học trên toàn quốc.\n\n3. Nội dung thi: Giải các bài tập thuật toán và cấu trúc dữ liệu.\n\n4. Các ngôn ngữ được sử dụng: C, C++, Python, Java\n\n5. Thời gian tổ chức:\n\n• Tháng 9/2024: Đăng ký dự thi: https://forms.gle/imFxNWopHfPjVYpt5\n\n• 12/10/2024: Vòng 1: Sơ loại: Thí sinh tham gia trực tuyến (Online). Thí sinh chủ động về thiết bị dự thi.\n\n• 19/10/2024: Vòng 2: Chung kết: 30 thí sinh xuất sắc nhất của vòng 1 sẽ tham dự vòng Chung kết trực tiếp tại Hà Nội (Offline). Các thiết bị hỗ trợ kỳ thi như máy tính, đường truyền Internet, bút, giấy nháp sẽ do Ban tổ chức hỗ trợ.\n\n \n\n6. Địa điểm tổ chức vòng chung kết (Dự kiến): Trường Đại học Duy Tân - Đà Nẵng .\n\n7. Cơ cấu giải thưởng gồm:\n\n☆ 01 Giải Nhất:\n\n- 15.000.000 VND (tiền mặt).\n\n- Kỷ niệm chương.\n\n- Giấy chứng nhận giải thưởng và phần quà đặc biệt từ LG Electronics R&D Vietnam.\n\n☆ 02 Giải Nhì, mỗi giải gồm:\n\n- 10.000.000 VND (tiền mặt).\n\n- Kỷ niệm chương.\n\n- Giấy chứng nhận giải thưởng và phần quà đặc biệt từ LG Electronics R&D Vietnam.\n\n☆ 02 Giải Ba, mỗi giải gồm:\n\n- 5.000.000 VND (tiền mặt).\n\n- Kỷ niệm chương.\n\n- Giấy chứng nhận giải thưởng và phần quà đặc biệt từ LG Electronics R&D Vietnam.\n\n☆ Tất cả các thí sinh tham dự vòng chung kết sẽ đều nhận được huy chương vinh danh và quà kỷ niệm từ LG Electronics R&D Vietnam.\n\n☆ Tất cả các thí sinh lọt vào vòng chung kết sẽ có thêm điểm cộng ưu tiên khi tham gia ứng tuyển vào các vị trí tại LG Electronics R&D Việt Nam.\n\nChúng tôi mong rằng, LG DREAM CODE sẽ tạo ra sân chơi bổ ích, cơ hội phát triển và chinh phục thử thách cho các sinh viên tài năng đam mê lập trình, cũng như tiếp thêm động lực để các em chinh phục đỉnh cao tri thức!\n\n8. Thông tin liên hệ:\n\n☆ Tại Hà Nội\n\nMs. Hiền Anh: anh.lam@lge.com\n\nFanpage: https://www.facebook.com/LGEDV\n\n☆ Tại Đà Nẵng\n\nMs. Minh Hằng: hang.tran@lge.com\n\nFanpage: https://www.facebook.com/LGERDVDN', 'thongbao', '2024-12-17 18:58:48', '2024-12-17 19:00:34', 'admin', 'admin');
INSERT INTO `news` (`id`, `title`, `thumbnail`, `shortdescription`, `content`, `categoryid`, `createddate`, `modifieddate`, `createdby`, `modifiedby`) VALUES
('tb07', 'HỌC BỔNG NGẮN HẠN VÀ HỌC BỔNG CHƯƠNG TRÌNH THẠC SĨ CỦA CHÍNH PHỦ LITHUANIA', , 'HỌC BỔNG NGẮN HẠN VÀ HỌC BỔNG CHƯƠNG TRÌNH THẠC SĨ CỦA CHÍNH PHỦ LITHUANIA', 'Căn cứ Thỏa thuận hợp tác giữa ĐHĐN và Đại học Mykolas Romeris, Lithuania vào tháng 11/2022, ĐHĐN thông báo các học bổng của Chính Phủ Lithuania năm học 2024-2025 như sau:\n\n1. Học bổng ngắn hạn (1-2 học kỳ)\n\nĐây là học bổng được cấp bởi chính phủ Lithunia và đây là cơ hội để sinh viên ĐHĐN nộp đơn xin học bổng để học tập tại Đại học Mykolas Romeris cho học kỳ mùa thu hoặc mùa xuân hoặc cho cả hai học kỳ (bao gồm 35 suất học bổng).\n\nGiá trị học bổng : 550 EUR / hàng tháng đối với sinh viên ; 1100 EUR / hàng tháng đối với nghiên cứu sinh\n\nNgôn ngữ tiếng Anh yêu cầu : Đại học Mykolas Romeris khuyến nghị sinh viên nhập học phải có trình độ tiếng Anh B1-B2\n\nTham khảo tại đây : https://studyin.lt/scholarships/short-term-studies/\n\nHạn chót nộp đơn trực tuyến là ngày 15/4/2024.\n\n2. Học bổng thạc sĩ của Nhà nước Litva\n\nĐây là học bổng dành cho sinh viên đại học năm cuối (hoặc sinh viên có bằng thạc sĩ) của các đối tác song phương đăng ký học thạc sĩ tại Đại học Mykolas Romeris.\n\nGiá trị học bổng : 550 EUR / hàng tháng\n\nThời hạn nộp hồ sơ: 22/5/2024\n\nĐể biết thêm thông tin chi tiết, vui lòng xem tại:\n\nTham khảo tại đây : https://studyin.lt/schol.../full-time-master-degree-studies/\n\n \n\n* Để ứng tuyển các học bổng trên, ứng viên vui lòng liên hệ Ban KH&HTQT, ĐHĐN, email : udicd@ac.udn.vn', 'thongbao', '2024-12-17 19:11:34', NULL, 'admin', NULL);
INSERT INTO `news` (`id`, `title`, `thumbnail`, `shortdescription`, `content`, `categoryid`, `createddate`, `modifieddate`, `createdby`, `modifiedby`) VALUES
('tt01', 'Sinh viên Bách khoa Đà Nẵng giành nhiều giải cao tại cuộc thi Olympic Tin học sinh viên Việt Nam lần thứ 33 và ICPC Asia Hanoi năm 2024', , 'Ngày 12-13/12/2024, đội tuyển sinh viên Trường Đại học Bách khoa, Đại học Đà Nẵng (ĐHĐN) đã tham dự và đạt thành tích cao với nhiều giải thưởng tại các cuộc thi: Olympic Tin học Sinh viên toàn quốc lần thứ 33 (OLP-2024) và ICPC Asia Hanoi năm 2024.', '“Cuộc thi năm nay hội tụ rất nhiều đội mạnh trên khu vực châu Á. Từ những đội có thành viên huy chương vàng Olympic Tin học Quốc tế đến những đội từ những trường đạt huy chương ICPC chung kết thế giới đến từ Hàn Quốc, Singapore, Đài Loan, Thái Lan, Philippines. Số lượng các đội cũng tăng nhiều hơn năm ngoái. Các đội tuyển của Nhà trường được chuẩn bị kỹ từ tháng 8/2024 nên tất cả các team ICPC năm nay đều có khả năng cạnh tranh xuất tham gia Asia Paciffic Championship (APC) tại Singapore. Mặc dù đề rất khó nhưng Đội BKDN.Arcane đã làm được 09/13 bài và đạt Huy chương Bạc tại cuộc thi và giành được 01 vé đi ACP, Đội BKDN.Chmod giải được 07/13 bài và đạt Đồng giải Ba cho các đội Việt Nam. Ba team còn lại đều trên 05 bài và thuộc top đầu trong các trường tham gia”, TS. Phạm Minh Tuấn - Giảng viên Khoa Công nghệ thông tin, Huấn luyện viên của đội tuyển đánh giá.', 'tintuc', '2024-12-17 12:52:01', '2024-12-17 18:35:54', 'admin', 'admin');
INSERT INTO `news` (`id`, `title`, `thumbnail`, `shortdescription`, `content`, `categoryid`, `createddate`, `modifieddate`, `createdby`, `modifiedby`) VALUES
('tt02', 'Lễ kỷ niệm chặng đường 45 năm hình thành và phát triển Ngành Công nghệ thông tin', , 'Sáng ngày 09/11/2024, tại Hội trường F, Trường Đại học Bách khoa, Đại học Đà Nẵng (ĐHĐN) đã diễn ra Lễ kỷ niệm 45 năm thành lập Ngành Công nghệ thông tin (CNTT). Đây là một dấu mốc quan trọng trên chặng đường phát triển 45 năm của Ngành CNTT (1979-2024) với nhiều kết quả đáng tự hào và cũng là dịp để Khoa CNTT tri ân các thế hệ đi trước và cùng hướng đến những mục tiêu phát triển mới trong tương lai.', 'Tham dự buổi lễ có sự hiện diện của các vị lãnh đạo, khách quý. Về phía Sở thông tin và Truyền thông TP. Đà Nẵng có ông Nguyễn Quang Thanh - Giám đốc Sở, Phó Chủ tịch Hội Tin học Việt Nam; ông Trần Ngọc Thạch - Phó Giám đốc. Về phía Đại học Đà nẵng có TS. Phan Minh Đức - Bí thư Đảng ủy, Chủ tịch Hội đồng ĐHĐN cùng đại diện lãnh đạo các trường đại học thành viên của ĐHĐN. Về phía Trường Đại học Bách khoa, ĐHĐN có PGS.TS Nguyễn Hữu Hiếu - Hiệu trưởng, PGS.TS Lê Tiến Dũng - Phó Hiệu trưởng và lãnh đạo các đơn vị Phòng, Khoa, Trung tâm. Về phía Khoa CNTT, có PGS.TS Nguyễn Tấn Khôi - Trưởng khoa, quý Thầy Cô nguyên là lãnh đạo Khoa CNTT và Thầy Cô giáo lão thành, toàn thể cán bộ, giảng viên đã và đang công tác tại Khoa CNTT, cùng tất cả các Nghiên cứu sinh, học viên cao học và sinh viên đã và đang học tập tại Khoa CNTT.\r\n\r\nBuổi lễ cũng vinh dự có sự góp mặt của đại diện lãnh đạo các công ty, doanh nghiệp và các Khoa thuộc các trường đại học ở khu vực miền Trung - Tây Nguyên có mối quan hệ hợp tác với Khoa CNTT.', 'tintuc', '2024-12-17 12:54:29', '2024-12-17 12:54:29', 'admin', 'admin');
INSERT INTO `news` (`id`, `title`, `thumbnail`, `shortdescription`, `content`, `categoryid`, `createddate`, `modifieddate`, `createdby`, `modifiedby`) VALUES
('tt03', 'Gần 200 đại biểu tham dự Hội thảo hợp tác giữa Nhà trường và Doanh nghiệp trong lĩnh vực Công nghệ thông tin', , 'Sáng ngày 26/10/2024, Trường Đại học Bách khoa - Đại học Đà Nẵng (ĐHĐN) đã tổ chức Hội thảo “Nhà trường và Doanh nghiệp Công nghệ thông tin năm 2024” với chủ đề: \"Định hướng đào tạo công nghệ thông tin trong kỷ nguyên AI\". Hội thảo nhằm nâng cao chất lượng đào tạo và thúc đẩy mối quan hệ hợp tác giữa nhà trường và các doanh nghiệp trong việc cung ứng nguồn nhân lực công nghệ thông tin trong kỷ nguyên mới.', 'Tham dự hội thảo có gần 200 đại biểu từ các cơ quan, tổ chức, doanh nghiệp trong và ngoài nước, các chuyên gia trong lĩnh vực Công nghệ thông tin trên địa bàn TP. Đà Nẵng và cả nước, cùng các em sinh viên chuyên ngành Công nghệ thông tin. \r\n\r\nPhát biểu tại hội nghị, PGS.TS Nguyễn Hồng Hải - Phó Hiệu trưởng Nhà trường cho biết, ngành Công nghệ thông tin của Trường Đại học Bách khoa -ĐHĐN được hình thành từ khá sớm, đến nay đã trở thành một ngành đào tạo có ưu thế mạnh của Nhà trường. Sinh viên khoa Công nghệ thông tin đạt rất nhiều thành tích xuất sắc trong các sân chơi lập trình ở trong nước và quốc tế như Cúp vô địch cuộc thi lập trình quốc tế ICPC 2023, Huy chương đồng ICPC Asia Jakarta 2023 và các giải thưởng cao của các lần ICPC Quốc gia và các cuộc thi lập trình khác,…', 'tintuc', '2024-12-17 12:54:29', '2024-12-17 12:54:29', 'admin', 'admin');
INSERT INTO `news` (`id`, `title`, `thumbnail`, `shortdescription`, `content`, `categoryid`, `createddate`, `modifieddate`, `createdby`, `modifiedby`) VALUES
('tt04', 'Hơn 300 sinh viên ngành Công nghệ thông tin tham gia Ngày hội việc làm IT Job Fair 2024', , 'Sáng ngày 26/10/2024, Trường Đại học Bách khoa - Đại học Đà Nẵng (ĐHĐN) đã tổ chức Ngày hội việc làm “IT JOB FAIR 2024” quy tụ hơn 300 sinh viên (SV) các ngành Công nghệ thông tin (CNTT) qua đó giới thiệu cơ hội việc làm và nghề nghiệp cho SV, tăng cường hợp tác giữa Nhà trường và Doanh nghiệp, đáp ứng nhu cầu xã hội.', 'Đây là sự kiện thường niên đã được Khoa Công nghệ thông tin, Trường Đại học Bách khoa chủ trì kết nối với các doanh nghiệp nhằm chia sẻ thông tin, nhu cầu và cơ hội việc làm cho SV các ngành CNTT.\r\n\r\nNăm nay, có đến 12 doanh nghiệp lớn là các nhà tuyển dụng uy tín trong và ngoài nước như: FPT Software, Axon Active, mgm, Renesa, CMC Global, Rikkeisoft, Code Complete, DAC, Pasona Tech,… đã trực tiếp phỏng vấn, tuyển dụng sinh viên ngay tại ngày hội, qua đó cho thấy nhu cầu nhân lực trong lĩnh vực CNTT nói riêng, công nghệ 4.0 nói chung là rất lớn.', 'tintuc', '2024-12-17 13:05:04', '2024-12-17 13:05:04', 'admin', 'admin');
INSERT INTO `news` (`id`, `title`, `thumbnail`, `shortdescription`, `content`, `categoryid`, `createddate`, `modifieddate`, `createdby`, `modifiedby`) VALUES
('tt05', 'TRIỂN KHAI TÀI LIỆU TUYÊN TRUYỀN, PHÒNG CHỐNG MA TÚY TẠI TRƯỜNG ĐHBK NĂM 2024', , 'TRIỂN KHAI TÀI LIỆU TUYÊN TRUYỀN, PHÒNG CHỐNG MA TÚY TẠI TRƯỜNG ĐHBK NĂM 2024', 'Thực hiện Kế hoạch số 5376/KH-C04-P1 ngày 01/12/2023 của Cục C04 Bộ Công an về việc xây dựng tài liệu tuyên truyền phòng, chống ma túy, Chương trình phối hợp số 03/CTrPH-BCA-BGDĐT ngày 22/01/2024 của Bộ Công an và Bộ Giáo dục và Đào tạo về tuyên truyền, phổ biến, giáo dục pháp luật phòng, chống ma túy trong các cơ sở giáo dục giai đoạn 2024 - 2030; Chương trình phối hợp số 768/CTrPH-CA-GDĐT, ngày 13/3/2024 của Công an và Sở Giáo dục và Đào tạo thành phố về triển khai thực hiện Chương trình tăng cường công tác tuyên truyền, phổ biến, giáo dục pháp luật phòng, chống ma túy trong các cơ sở giáo dục giai đoạn 2024 - 2030 trên địa bàn thành phố; Kế hoạch số 103/KH-CATP-PCSMT ngày 19 tháng 3 năm 2024 của Công an thành phố Đà Nẵng về triển khai tài liệu tuyên truyền, phòng chống ma túy năm 2024, Trường Đại học Bách khoa xây dựng Kế hoạch triển khai tài liệu tuyên truyền, phòng chống ma túy năm 2024 (nội dung Kế hoạch và tài liệu tuyên truyền) được gửi kèm theo email này.\n\nKẾ HOẠCH TRIỂN KHAI TÀI LIỆU TUYÊN TRUYỀN PHÒNG CHỐNG MA TÚY NĂM 2024\n\nPHIM NGẮN TÌNH HUỐNG GIẢ ĐỊNH, THỦ ĐOẠN TỘI PHẠM MA TÚY\n\nPHIM TÀI LIỆU KHOA HỌC - KIẾN THỨC PHÒNG CHỐNG MA TÚY', 'thongbao', '2024-12-17 19:10:09', NULL, 'admin', NULL);
INSERT INTO `news` (`id`, `title`, `thumbnail`, `shortdescription`, `content`, `categoryid`, `createddate`, `modifieddate`, `createdby`, `modifiedby`) VALUES
('tt06', 'Máy tính Minsk-22 vào Đà Nẵng', , 'Tác giả kể lại câu chuyện máy tính điện tử (MTĐT) Minsk-22 (gọi tắt là máy Minsk-22) vào Đà Nẵng năm 1982. Máy Minsk-22 thuộc thế hệ 2, sử dụng linh kiện bán dẫn, thuộc dòng máy Minsk, được sản xuất tại thành phố Minsk, thủ độ nước CH Belarus (thuộc Liên Xô cũ). Máy Minsk-22, đầu tiên đến Hà Nội, sau đó đến Đà Nẵng, là chiếc MTĐT thế hệ 2 cuối cùng (cũng là loại MTĐT duy nhất ở Việt Nam thời đó) chứng kiến một giai đoạn lịch sử trong tiến trình phát triển CNTT ở Việt Nam nói chung, ở Đà Nẵng, Miền Trung nói riêng.', 'Cách đây không lâu, tình cờ vào mạng tìm kiếm tài liệu với Google, tôi tìm đọc được một bài báo thú vị nói về thầy giáo Nguyễn Bá Hào của anh Nguyễn Đăng Hà, cựu sinh viên K13, thuộc khoa Toán-Lý (trước đây là Khoa Cơ bản), trường ĐHBK Hà Nội. Thầy Nguyễn Bá Hào cũng là thầy cũ của tôi. Đó là thời gian tôi được phục viên, rời quân ngũ về tiếp tục học lại đại học với lớp K19 Toán-Tính (viết tắt cụm từ “Toán học Tính toán”), cùng khoa Toán-Lý. Hồi đó chúng tôi được gọi là “bộ đội đi học”, do đã hoàn thành nghĩa vụ quân sự. Nhớ lại, tôi vào học K14 Toán-Lý được hai năm, từ năm 1971 đến 1976, tôi nhập ngũ, vào Đoàn Pháo 75 tại chiến trường B2 Miền Đông và Miền Tây Nam Bộ. Thầy Nguyễn Bá Hào đã dạy chúng tôi các môn “Hệ điều hành”, “Ngôn ngữ lập trình COBOL”. Tôi cũng được học với các thầy khác, thầy Nguyễn Văn Ba, Đỗ Xuân Lôi… Các thầy đã dẫn dắt chúng tôi đi vào thế giới mới lạ của MTĐT, tạo dựng niềm say mê và ham thích lập trình cho đến ngày nay. Ngành Toán-Tính, lập trình cho MTĐT (nay là Tin học, CNTT), hồi đó vẫn còn rất mới mẻ. Đến tháng 10 năm 1979, tôi tốt nghiệp ra trường và “được” Bộ Đại học và Trung học Chuyên nghiệp (nay là Bộ Giáo dục và Đào tạo) phân công, bổ nhiệm vào trường ĐHBK Đà Nẵng. Thấm thoắt đã 34 năm trôi qua. Năm 2013 này, trường ĐHBK Hà Nội tuyển sinh khoá K58.\n\nĐiều đáng nói, anh Nguyễn Đăng Hà đã nhắc lại những kỷ niệm về thực hành lập trình trên máy MTĐT Minsk-22 tại nhà 39 Trần Hưng Đạo, Hà Nội. Chình điều này đã thôi thúc tôi tìm cách để viết bài báo này, hồi tưởng lại một thời đã học đại học ở Hà Nội, có dịp làm việc với máy Minsk-22. Tưởng rằng sẽ không có dịp nào để trở về lại quá khứ đó, nhưng như một cơ duyên, tôi lại gặp lại máy Minsk-22 “bằng xương bằng thịt” ở trường ĐHBK Đà Nẵng vào đầu những năm 80, với bao sự kiện đáng nhớ.\n\nCâu chuyện này kể lại từ lúcMTĐT Minsk-22 có mặt tại Phòng Toán học Tính toán, thuộc Uỷ ban Khoa học Kỹ thuật Nhà nước (UBKHKTNN) năm 1968, sau đó được bốc chuyển đến trường ĐHBK Hà Nội năm 1980, rồi được bốc chuyển bằng ô tô vào Đà Nẵng năm 1982, từ đó vĩnh viễn biến mất. Qua các sự kiện chảy theo dòng thời gian của những năm 60, 70 và 80 của thế kỷ trước, từng bước hồi tưởng lại những kỷ niệm khó quên mà tôi được biết, được làm người trong cuộc.', 'tintuc', '2024-12-17 18:56:12', NULL, 'admin', NULL);
INSERT INTO `news` (`id`, `title`, `thumbnail`, `shortdescription`, `content`, `categoryid`, `createddate`, `modifieddate`, `createdby`, `modifiedby`) VALUES
('tt07', 'Nghiên cứu sinh Trần Quang Phúc bảo vệ thành công luận án Tiến sĩ ở đơn vị  chuyên môn, ngành Khoa học máy tính với đề tài: “Khai phá quan điểm với các phương pháp quần thể”', , 'Sáng ngày 14/9/2024, Trường Đại học Bách khoa, Đại học Đà Nẵng (ĐHĐN) đã tổ chức đánh giá luận án Tiến sĩ ở đơn vị chuyên môn cho Nghiên cứu sinh (NCS) Trần Quang Phúc, ngành Khoa học máy tính với đề tài: “Khai phá quan điểm với các phương pháp quần thể”.', 'Luận án “Khai phá quan điểm với các phương pháp quần thể” tập trung vào việc đề xuất và thử nghiệm các giải pháp nhằm cải thiện hiệu quả, hiệu suất, tăng cường khả năng diễn giải của mô hình khai phá quan điểm. Kết quả đạt được của luận án đã đề cập đến vấn đề có liên quan đến xây dựng tập dữ liệu quan điểm và đề xuất mô hình khai phá quan điểm mới, cụ thể là khai phá quan điểm với các phương pháp quần thể.\n\nCác kết quả chính của luận án gồm có:\n\n- Đề xuất giải pháp cải thiện việc trích xuất các từ quan điểm và khai phá quan điểm theo số đông bằng các phương pháp quần thể. Mô hình khai phá quan điểm dựa trên tiếp cận học máy quần thể đã được cài đặt, thử nghiệm, đánh giá, cho kết quả chính xác so với mô hình học máy riêng lẻ;\n\n- Đề xuất chuyển đổi dữ liệu quan điểm thành bộ năm quan điểm từ hai bộ dữ liệu chuẩn về nhà hàng, khách sạn (yelpHoltelData và yelpResData) được sử dụng để thử nghiệm và đánh giá mô hình khai phá quan điểm đề xuất;\n\n- Đề xuất mô hình khai phá quan điểm với rừng phân loại nhằm giải quyết vấn đề ảnh hưởng quần thể/số đông theo tầm quan trọng của các nhóm/lớp quan điểm khác nhau và diễn giải mô hình;\n\n- Đề xuất mô hình khai phá quan điểm với mật độ rừng để giải quyết vấn đề ảnh hưởng quần thể/số đông theo tầm quan trọng của các tập/cụm quan điểm khác nhau và diễn giải mô hình;\n\n- Đề xuất mô hình khai phá quan điểm với một rừng đa tạp để giải quyết vấn đề ảnh hưởng của quần thể/số đông theo mối quan hê của các tập hợp/cụm quan điểm khác nhau và giải thích mô hình, xử lý các thách thức của dữ liệu quan điểm đa dạng và nhiễu.', 'tintuc', '2024-12-17 18:57:35', NULL, 'admin', NULL);

